        "body": "## Concept\r\n\r\n### Perceptron\r\n\r\n`感知机`为双层神经网络，用于处理简单的二分类模型，根据给定阈值判断数据属于哪种类型。\r\n\r\n### Muti-net\r\n\r\n- `input layer`\r\n- `output layer`\r\n- `hidden layer`\r\n- `full-connect layer`: 全连接层第 n 层和第 n-1 层中神经元两两之间都有连接（`y = Wx + b`）\r\n\r\n### Activation Function\r\n\r\n`激活函数`用于激活神经元，增加模型的非线性分割能力,使输出结果表现为非线性（曲线），若无激活函数，多层神经网络相对于感知机无任何改进，图像仍表现线性。\r\n\r\n- `Sigmoid`\r\n\r\n- `tanh` \r\n\r\n- `Relu`\r\n\r\n- `Maxout` \r\n\r\n- `Leaky Relu`\r\n\r\n- `ELU`\r\n\r\n   \r\n\r\n\r\n",
